<Russian>:
Вы хотите 'продвинутое' управление или 'простое'?
В любом виде управления мышь управляет самолётом, колёсико мышки - газом.
'Продвинутое': WASD+QE (и стрелочки) управляют направлением самолёта, газ управляется LShift + LCtrl;
'Простое': WS и стрелочки вверх\вниз отвечают за управление газом; AD+QE - крен и курс;
